import React from 'react';
import Button from '@material-ui/core/Button';


export const Buttons  = ({texto="btn" , color="secondary", onGenerar}) => {
            const ejecu =(e)=>{
                e.preventDefault()
                onGenerar()
            }

    return(
        <Button variant="contained" onClick={ejecu} color={color}>
            {texto}
       </Button>
    )
}
